import React from "react";
import { SearchBar } from "antd-mobile";
import { LeftOutline } from "antd-mobile-icons";
import styled from "styled-components";
const StyleSearch = styled(SearchBar)`
  border: 1px solid #999;
  overflow: hidden;
  border-radius: 10px;
  .adm-search-bar-input-box {
    background: #fff;
    border: unset;
  }
  button {
    border-radius: 0;
    font-size: 12px;
    border-left: 1px solid #999;
    color: #1677ff;
  }
`;
class Bar extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <>
        <div>
          <LeftOutline />
        </div>
        <StyleSearch
          placeholder="请输入内容"
          showCancelButton={() => true}
          className=" w-[90%]"
          cancelText="搜索"
          style={{ "placeholder-color": "#1677ff" }}
          clearOnCancel={false}
        />
      </>
    );
  }
}
export default Bar;
